import Button from 'react-bootstrap/Button';
import { useNavigate } from "react-router-dom";
import React from 'react';
import '../styles.css';

let navigate = useNavigate(); 
const routeChange = (path) =>{ 
    // let path = `/`; 
    navigate(path);
}

const navBar = ({navBar}) => { 
    return(<div className="navBar">
        <Button onClick={routeChange} variant="dark" style={{border: "1px solid white", margin: "5px"}}>{"Inicio"}</Button>
        <Button onClick={routeChange} variant="dark" style={{border: "1px solid white", margin: "5px"}}>{"Productos"}</Button>
        <Button onClick={routeChange} variant="dark" style={{border: "1px solid white", margin: "5px"}}>{"Contacto"}</Button>
    </div>) 
}

export default navBar;
